import React, {Fragment} from 'react';
import Insta from '../UI/assets/instagram.png';
import FooterRiverPic from "../UI/assets/FooterImg.jpeg";
import classes from './FooterContact.module.css';

function FooterContact () {
    return (
        <Fragment>
            <section className={classes.fi} >
                <img src={FooterRiverPic} alt="Grand Canyon"/>
            </section>
            <footer style={{textAlign:'center'}}>
                <h2>Contact Info</h2>
                <ul>
                    <li>
                        Email: <a href="mailto:alora@beebettermassage.com">alora@beebettermassage.com</a>
                    </li>
                    <li>
                        Phone: 385-313-0591
                    </li>
                    <li><a href="https://www.instagram.com/bee.better.massage"><img src={Insta} alt="instagram"/></a></li>
                </ul>
            </footer>



        </Fragment>
    )
}
export default FooterContact;
